query ArticleTemplate(
  $id: String!
) {
  strapiArticles(id: {eq: $id}) {
    id
    title
    slug
    content
    author {
      id
      username
    }
  }
}

query IndexQuery {
  allStrapiArticles {
    edges {
      node {
        id
        slug
        title
        shortdesc
        date
        content
        author {
          id
          username
        }
      }
    }
  }
}
